import React from 'react'
import Link from 'next/link'
import fetch from 'isomorphic-unfetch';
import Header from '../components/presentations/header'

const Index = props => (
  <div className='body-container'>
    <Header />

    <style jsx>{`
      .body-container {
        margin: 0 auto !important;
        width: 100% !important;
      }

      div {
        margin: 0 auto !important;
        width: 100% !important;
      }
    `}</style>
  </div>
)

